# Definition for singly-linked list.
class ListNode:
    def __init__(self, x):
        self.val = x
        self.next = None

class Solution:
    def sortList(self, head: ListNode) -> ListNode:
        """
        :type head: ListNode
        :rtype: ListNode
        """
        if head == None:
            return head
        if head.next == None:
            return head
        
        # tail = ListNode(float('inf'))
        
        n = 0
        l = head
        while l != None:
            n += 1
            l = l.next
        
        self.sorted(head, n)
        return head
        
        
        
    def sorted(self, l, n):
        if n > 1:
            n -= 1
            head = l
            pivot = l.val
            mid = ListNode(float('-inf'))
            n1 = n2 = 0
            mid.next = head.next
            head = head.next
            
            while n > 0:
                if head.val < pivot:
                    mid = mid.next
                    head.val, mid.val = mid.val, head.val
                    n1 += 1
                else:
                    n2 += 1
                head = head.next
                n -= 1
                
            if mid.val > float('-inf'):
                l.val, mid.val = mid.val, l.val
                self.sorted(l, n1)
                self.sorted(mid.next, n2)
            else:
                self.sorted(l.next, n2)


