# Definition for singly-linked list.
# class ListNode:
#     def __init__(self, val=0, next=None):
#         self.val = val
#         self.next = next
class Solution1:
    def sortList(self, head: ListNode) -> ListNode:
        def partition(s, e):
            p1, p2 = s, s.next
            while p2 != e:
                if p2.val <= s.val:
                    p1 = p1.next
                    p1.val, p2.val = p2.val, p1.val
                p2 = p2.next
                
            p1.val, s.val = s.val, p1.val
            
            return p1
            
        def quicksort(s, e):
            if s != e:
                m = partition(s, e)
                quicksort(s, m)
                quicksort(m.next, e)
            
        quicksort(head, None)
        return head
        

