class Solution(object):
    def sortList(self, head):
        """
        :type head: ListNode
        :rtype: ListNode
        """
        # try quick sort
        def get_mid(head):
            s = f = head
            while f and f.next:
                s, f = s.next, f.next.next
            return s.val
        
        def partition(head, val):
            # partition around val
            fake_l = l = ListNode(0)
            fake_m = m = ListNode(0)
            fake_r = r = ListNode(0)
            cur = head
            while cur:
                if cur.val < val:
                    l.next = cur
                    l = l.next
                elif cur.val == val:
                    m.next = cur
                    m = m.next
                else:
                    r.next = cur
                    r = r.next
                cur = cur.next
            l.next, m.next, r.next = None, None, None
            return fake_l.next, fake_m.next, fake_r.next
        
        def get_tail(head):
            cur = head
            while cur.next:
                cur = cur.next
            return cur
        
        def combine(l, m, r):
            # l, m, r could be None
            fake = ListNode(0)
            fake.next = l
            t = get_tail(fake)
            t.next = m
            t = get_tail(t)
            t.next = r
            return fake.next
        
        if not head or not head.next:
            return head
        l, m, r = partition(head, get_mid(head))
        l = self.sortList(l)
        r = self.sortList(r)
        return combine(l, m, r)


